import React from 'react';
import Header from './components/Header';
import TrainDetails from './components/TrainDetails';
import CustomerDetails from './components/CustomerDetails';

function App() {
  return (
    <div style={{background:"Black"}}>
       <Header/><br/>
       <TrainDetails/>
       <CustomerDetails/>
    </div>
  );
}

export default App;
